script: |
  super -f text -I q6553.spq | sort > q6553.out

inputs:
  - name: q6553.spq
    data: |
      SELECT DISTINCT col2 / - + col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + 75 NOT BETWEEN + 57 AND - - col0 - - 97;
  - name: tab0

outputs:
  - name: q6553.out
    data: |
      -1
      -3
      0
